import styles from "./App.module.css";
import { useState } from "react";

function App() {
  const [counter, setcount] = useState(0);
  const onClick = () => {
    setcount((current) => current + 1);
  };

  return (
    <div>
      <h1 className={styles.title}>Welcome to React</h1>
      <Btn text={"save"} />
    </div>
  );
}

export default App;
